import styled from "styled-components"
import Navbar from "../components/Navbar"
import Announcement from "../components/Announcement"
const Container = styled.div``

const Product = () => {
  return (
   <Container>
    <Navbar/>
    <Announcement/>
    
   </Container>
  )
}

export default Product
